import React, { Component } from 'react';
import { StyleSheet, View, Text, Dimensions } from 'react-native';
import MapView from 'react-native-maps';

class Map extends Component {
  render() {
    return (
      <MapView
          initialRegion={
            {
              latitude: 43.700859,
              longitude: -72.289398,
              latitudeDelta: 0.0,
              longitudeDelta: 0.0,
            }
          }
          // style={styles.map}/>
      // <View style={styles.container}>

      // </View>
      />
    );
  }
}

